import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Open the cart modal (try clicking the cart div by text "Cart")
    await page.waitForSelector('//div[contains(@class,"cart") and contains(text(),"Cart")]', { timeout: 5000 });
    await page.click('//div[contains(@class,"cart") and contains(text(),"Cart")]');

    // Wait for cart modal to appear (look for cart modal by id or class)
    // Try by id first (common: #cartModal)
    let cartModalSelector = '#cartModal';
    let cartModalExists = await page.$(cartModalSelector);
    if (!cartModalExists) {
      // Try by class
      cartModalSelector = '.cart-content';
      await page.waitForSelector(cartModalSelector, { timeout: 5000 });
    } else {
      await page.waitForSelector(cartModalSelector, { timeout: 5000 });
    }

    // Take screenshot after opening cart
    const step2 = path.join(screenshotsDir, 'step_2_cart_opened.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for at least one "Remove" button (remove-item class)
    await page.waitForSelector('//button[contains(@class,"remove-item")]', { timeout: 5000 });

    // Click the first Remove button
    const removeButtons = await page.$$('//button[contains(@class,"remove-item")]');
    if (removeButtons.length === 0) {
      throw new Error('No remove buttons found in cart');
    }
    await removeButtons[0].click();

    // Wait for cart to update (either the item disappears or "Your cart is empty" appears)
    // Wait for either: no remove-item buttons OR "Your cart is empty" text
    let cartEmpty = false;
    try {
      await page.waitForSelector('//div[contains(@class,"empty-cart") and contains(text(),"Your cart is empty")]', { timeout: 5000 });
      cartEmpty = true;
    } catch (e) {
      // If not empty, wait for remove-item button count to decrease
      await page.waitForTimeout(800); // brief pause for UI update
    }

    // Take screenshot after removal
    const step3 = path.join(screenshotsDir, 'step_3_item_removed.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract cart status: is cart empty or how many remove buttons left
    let remainingRemoveButtons = await page.$$('//button[contains(@class,"remove-item")]');
    let extractedData = {};
    if (cartEmpty) {
      extractedData.cartStatus = "empty";
    } else {
      extractedData.cartStatus = "not empty";
      extractedData.remainingItems = remainingRemoveButtons.length;
    }

    return {
      success: true,
      action: "Removed an item from the cart using the Remove button in the cart modal.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
